  false,\n\t\"url\": null,\n\t\"notes\": \"The Trinidad Head Line (THL) is a transect
  of stations extending due west from Trinidad Head (41u00b0 3.5u00bf N)  The THL
  was initially established in late 2006 to provide ship-based observations of hydrographic
  structure and the planktonic ecosystem in coastal waters off northern California.
  \ Since 2008, sampling has been conducted approximately monthly.  Sampling is conducted
  at up to six stations along the transect, three of which are over the shelf and
  three over the upper slope.  Data collected include hydrographic casts at each station,
  which measure temperature, salinity, and a suite of ancillary parameters.  Physical
  samples collected include water samples for asssay of nutrient and chlorophyll concentrations,
  and net tows for zooplankton.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
